import styled from "styled-components";

export const Container = styled.div`
  position: fixed;
  bottom: 0;
  left: 0;
  min-height: 80vh;
  width: 100vw;
  background-color: #121212;
  z-index: 0;
  color: #fff;
  display: flex;
  flex-direction: column;
  justify-content: center;

  h2 {
    color: pink;
  }
`;
